import React, { FC } from "react"


//1.在一个element下面，
    // 每一个attribute都占用一个代码块，
    // =左右两边不需要空格，
    // attributes之间不需要逗号

/**2.REACT JS中CSS的写法用两个大括号来写
 * 子的attribute每个占用一行
 * key: value的形式，左边有空格，右边有空格
 * 子的attributes之间用逗号
 */

const Statistics: FC = (): JSX.Element => {
    return (
        <div>
            <table
                title="This is present table for bees" 
                style={{ 
                    width: "100%", 
                    marginBottom: "10px",
                    border: "1px solid black"
                }}
            >
                <tr>
                    <th>Firstname</th>
                    <th>Lastname</th>
                    <th>Age</th>
                </tr>
                <tr>
                    <td>Jill</td>
                    <td>Smith</td>
                    <td>50</td>
                </tr>
                <tr>
                    <td>Eve</td>
                    <td>Jackson</td>
                    <td>94</td>
                </tr>
            </table>
        </div>
    )
}
export default Statistics;
